import React from 'react'
import styles from "./Home.module.css"
import homeIllustration from '../../Assets/homeIllustration.png'
const Home = () => {
  return (
    <div className={styles.container}> 
  {/* <img src={homeIllustration} className={styles.ill_img}></img> */}
    <div>
      <div className={styles.home-text_font}>Technocrats</div> 
      <div className={styles.home-text_font-2}>Lead-collaborate-Explore</div>
    </div>

    </div>
  )
}

export default Home
